// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 <0.9.0;

contract FundMe {

    event NewContract(string title, string body, uint goal, uint balance);
    event Deposit(address sender, uint amount, uint balance);
    event Liquidate(address owner, uint balance);

    struct Fund {
        string title;
        string body;
        uint goal;
        uint balance;
        address owner;
    }

    mapping(address => Fund) public funds;

    address owner;

    constructor() {
        owner = msg.sender;
    }

    function createNewFund(string memory _title, string memory _body, uint _goal) public {
        require(funds[msg.sender].owner == address(0), "Must not already have a fund open on your account");
        require(_goal != 0, "Must specify a minimum goal amount of funds");
        require(funds[msg.sender].goal == 0, "Already created a fund under this account");
        funds[msg.sender] = Fund(_title, _body, _goal, 0, msg.sender);
        emit NewContract(_title, _body, _goal, 0);
    }

    function contributeToFund(address _accountToFund) public payable {
        require(funds[_accountToFund].owner != address(0), "The the account you wish to donate to has no fund attached to their account");
        funds[_accountToFund].balance += msg.value;
        emit Deposit(msg.sender, msg.value, funds[_accountToFund].balance);
    }

    function liquidateYourFund() public {
        uint balance = funds[msg.sender].balance;
        uint fee = balance/100;
        uint payOut = fee*99;
        payable(owner).transfer(fee);
        payable(msg.sender).transfer(payOut);
        emit Liquidate(msg.sender, funds[msg.sender].balance);
        delete funds[msg.sender];
    }

}
